        markdown: |+
          #नाचिरहनुहोस्!

           भाग २ का लागि, तपाईंले आफ्नै परियोजना सिर्जना गर्न लाग्नुभएको छ । यहाँ कुनै पहेलीहरु छैनन् - यसको सट्टा त्यहाँ परियोजनाहरु को एक गुच्छा छन् जस्ले अधिक जटिल डान्स पार्टीहरु बनाउन को लागी विभिन्न तरीकाहरु देखाउँछन्।

          तपाईंले यी स्तरहरु  _in any order_ गर्न सक्नुहुन्छ । अघिल्लो तहमा केही कसरी गरियो हेर्न वरिपरि जम्प गर्नुहोस्, वा परियोजनाको बीचमा अवधारणाहरु संयोजन गर्नुहोस् । ती सबै प्रयास गर्नुहोस्, आफूलाई मनपर्ने कुरा छान्नुहोस् र त्यो परियोजनालाई आफ्नो बनाउन थप समय बिताउनुहोस् ।

